import React from "react";
import ConfigFooter from '../capas/footer/footer';
import ConfigHead from '../capas/head/head';
import Form from "../capas/formulario/formulario";
import '../capas/head/navbar.css'

 
class NavBarContacto extends NavBarExample{
    render(){

    }
}

class ConfigHeadContacto extends ConfigHead{
    render(){
        return(
            <div className='mainDivNav'>
        <Navbar className="nav" variant="dark" expand="lg">
          <Container>
            <Navbar.Brand href=""> </Navbar.Brand>
            <Navbar.Toggle className="menu"aria-controls="basic-navbar-nav"/>
            <Navbar.Collapse id="basic-navbar-nav">
              <Nav className={fix ? 'navs fixed' : 'navs'} >
                <Nav.Link className='inicio' href="/">Inicio</Nav.Link>
                <Nav.Link className='contacto'href="/contacto">Contacto</Nav.Link>
                <Nav.Link className='curriculum'href="/cv">Curriculum</Nav.Link>
              </Nav>
            </Navbar.Collapse>
          </Container>
        </Navbar>
        

        <section className="outlet">
          <Outlet> </Outlet>
        </section>
</div>

        )
    }
}


const Contacto = () =>  {
    return(
    <div>
        <ConfigHead/>        

        <Form/>
            
        <ConfigFooter/>
    </div>
    )
};




export default Contacto;
